#### Q19. What is the error in this code?

```swift
extension String {
  var firstLetter: Character = "c" {
    didSet {
      print("new value")
    }
  }
}
```

- %OPTION% Extensions can't add properties. // although extensions technically can't contain stored properties
- %OPTION% Nothing is wrong with it.
- %OPTION% didSet takes a parameter.
- %OPTION% c is not a character.

