#### Q40. What is wrong with this code?

```swift
protocol TUI {
  func add(x1 : Int, x2 : Int) -> Int {
    return x1 + x2
  }
}
```

- %OPTION% Protocol functions cannot have return types.
- %OPTION% Protocol functions cannot have implementations.
- %OPTION% Nothing is wrong with it.
- %OPTION% `add` is a reserved keyword.

